docs/integration-testing/.body:
통합 테스트
글로벌 Promise가 필요합니다.
Redux Saga Test Plan은 통합 테스트를 위해 saga가 반환하는 이팩트를 검증하기 위한 API를
반환하는 expectSaga함수를 제공합니다. expectSaga를 사용하기 위해서는 제너레이터 함수를 
첫 번째 인수로 전달합니다. 그리고 그 제너레이터 함수에 전달될 인수들을 추가적으로 전달합니다.

expectSaga는 Redux Saga의 runSaga 함수를 사용하여 saga를 실행하기 때문에 실제 앱에서
동작 하는 것처럼 실행될 것입니다. saga가 비동기적으로 실행되는 것 처럼 expectSaga 역시 비동기적으로
실행됩니다.

expectSaga를 호출하고 검증문을 작성한 후에 run 메서드로 saga를 시작할 수 있습니다. run
메서드는 Promise를 반환하고 당신이 좋아하는 테스팅 프레임워크와 함께 사용할 수 있습니다. 검증이
실패한다면 expectSaga는 반환된 Promise를 리젝트(reject)할 것입니다. 모든 검증이 통과되면,
Promise는 리졸브(resolve)될 것입니다.

다음 예제는 테스팅 프레임워크로 Jest를 사용했습니다. 
테스트가 완료될때 Jest가 알 수 있도록 Promise를 반환합니다. 그리고 expectSaga로 call을 
테스트하지도 않았습니다.

import { call, put } from 'redux-saga/effects';
import { expectSaga } from 'redux-saga-test-plan';

function* mainSaga(x, y) {
  yield call([console.log, console], 'hello');
  yield put({ type: 'ADD', payload: x + y });
}

it('puts an ADD action', () => {
  return expectSaga(mainSaga, 40, 2)
    // saga가 최종적으로 예상되는 액션을 `put` 하는지 검증합니다.
    .put({ type: 'ADD', payload: 42 })

    // run it
    .run();
});

docs/integration-testing/dispatching.htm.body:
액션 디스패치하기
대부분의 saga들은 Redux 액션을 대기하는 take 이팩트를 사용합니다. expectSaga는
saga를 단순히 실행하기만 하기 때문에 take 이팩트가 반환되면 saga 실행이 멈추게됩니다.
saga를 계속 실행하기 위해서 (일반적으로 saga가 그러하듯) expectSaga 또한 dispatch가
필요합니다. saga를 실행하기 전에 saga가 기대하는 모든 작업을 원하는 순서대로 디스패치하세요.
expectSaga는 내부적으로 액션들을 큐에 넣고 필요할때마다 당신을 대신해서 액션들을 디스패치
할것입니다.

import { put } from 'redux-saga/effects';
import { expectSaga } from 'redux-saga-test-plan';

function* mainSaga(x, y) {
  yield take('HELLO');
  yield put({ type: 'ADD', payload: x + y });
  yield take('WORLD');
  yield put({ type: 'DONE' });
}

it('handles dispatching actions', () => {
  return expectSaga(mainSaga, 40, 2)
    // 검증은 순서와 상관 없습니다.
    .put({ type: 'DONE' })
    .put({ type: 'ADD', payload: 42 })

    // saga가 `take`한 순서대로 액션을 디스패치하세요.
    .dispatch({ type: 'HELLO' })
    .dispatch({ type: 'WORLD' })

    .run();
});

시간이 걸리는 액션 디스패치
saga의 실행에 시간이 걸리는 액션을 디스패치할 수도 있습니다. 이 경우, Redux Saga Test Plan이 너무 빠르게
디스패치 못하도록 액션을 지연하는것이 좋습니다.

function* mainSaga() {
  // 거의 바로 실행됨
  yield take('FOO');

  // 250ms 걸림
  yield take('BAR');
  yield put({ type: 'DONE' });
}

const delay = time => new Promise((resolve) => {
  setTimeout(resolve, time);
});

it('can dispatch actions while running', () => {
  const saga = expectSaga(mainSaga);

  saga.put({ type: 'DONE' });

  saga.dispatch({ type: 'FOO' });

  const promise = saga.run({ timeout: false });

  return delay(250).then(() => {
    saga.dispatch({ type: 'BAR' });
    return promise;
  });
});

.delay()로 액션을 지연시켜서 디스패치하기
실행 시간이 걸리는 액션을 디스패치하기 위해 지연시키는 것 말고도 다른 방법이 있습니다. 액션이 
디스패치되기만을 지연시키고 싶다면 delay 사용하세요. delay의 인자는 지연시킬 시간입니다. 

function* mainSaga() {
  // 거의 바로 실행됨
  yield take('FOO');

  // 250ms 걸림
  yield take('BAR');
  yield put({ type: 'DONE' });
}

it('can delay actions', () => {
  return expectSaga(mainSaga)
    .put({ type: 'DONE' })
    .dispatch({ type: 'FOO' })
    .delay(250)
    .dispatch({ type: 'BAR' })
    .run({ timeout: false });
});

docs/integration-testing/timeout.html.body:
시간제한
expectSaga는 비동기적으로 saga를 실행하기 때문에, saga가 너무 오래 실행될 경우을 대비해 기본적인
시간제한을 가집니다. 무한 루프의 다중 비둥기 액션을 가지는 saga나 takeEvery 같은 헬퍼함수를 사용하는
saga에 필요합니다. expectSaga는 시간이 초과되면 경고메시지를 출력하고 saga를 중지합니다.

function* mainSaga() {
  while (true) {
    const action = yield take('READY');
    yield put({ type: 'DATA', payload: action.payload });
  }
}

it('times out', () => {
  return expectSaga(mainSaga)
    .put({ type: 'DATA', payload: 42 })
    .dispatch({ type: 'READY', payload: 42 })

    // saga는 스스로 종료되지 않음
    // 250ms가 지나면 saga가 취소되고 콘솔에 경고 메시지를 출력함
    .run();
});

경고 없애기
경고 메시지는 무한 루프 없이도 너무 오래 걸리는 saga를 테스트하기에도 유용합니다. 무한 루프를 가지는
saga라도 시간 초과해서 계속하기를 원할 수 있습니다. 그렇다면 경고 메시지를 없애기 위해 silentRun
메서드를 사용하면 됩니다. 이 함수는 run 메서드와 동일하지만 Redux Saga Test Plan의 시간 초과
경고를 무시합니다. 알림: 테스트 프레임워크의 모든 시간 초과 경고를 무시하지는 않습니다. 
(예를 들면 Jest 같은)

it('can be silenced', () => {
  return expectSaga(mainSaga)
    .put({ type: 'DATA', payload: 42 })
    .dispatch({ type: 'READY', payload: 42 })

    // 경고 메시지가 출력되지 않습니다.
    // 시간 초과하는것이 예측될 경우 유용함
    .silentRun();
});

run 메서드에 옵션으로 silenceTimeout를 전달함으로써 시간 초과를 무시하는 예전 방법도 여전히 가능합니다.
하지만 silentRun 메서드를 사용하는 것이 더 좋습니다.

it('can be silenced', () => {
  return expectSaga(mainSaga)
    .put({ type: 'DATA', payload: 42 })
    .dispatch({ type: 'READY', payload: 42 })

    // 여전히 작동하지만 타이핑할게 많다.
    .run({ silenceTimeout: true });
});

시간제한 적용하기
시간제한 길이를 조정할 수 있습니다. 기본값은 250ms 입니다. expectSaga의 DEFAULT_TIMEOUT
프로퍼티 값을 ms단위로 설정하여 시간제한을 변경할 수 있습니다.

expectSaga.DEFAULT_TIMEOUT = 500; // set it to 500ms

특별한 경우 프로퍼티의 기본값을 무시하고 싶다면, run (혹은 silentRun) 메서드를 실행할 때
시간 제한 길이를 인자로 전달하면 됩니다.

const delay = time => new Promise(resolve => setTimeout(resolve, time));

function* mainSaga() {
  yield call(delay, 300);
  yield put({ type: 'HELLO' });
}

it('can have a different timeout length', () => {
  return expectSaga(mainSaga)
    .put({ type: 'HELLO' })

    // saga는 최소 300ms 걸림
    // 시간제한이 500ms이므로 정상적임
    .run(500);
});

또는 run 메서드에 false를 전달하여 saga가 스스로 종료될 때까지 expectSaga가 기다리게
할 수 있습니다. 경고: 무한 루프로 동작하는 saga 일경우 스스로 종료되지 않기 때문에 동작하지
않을 것입니다.

it('never times out', () => {
  return expectSaga(mainSaga)
    .put({ type: 'HELLO' })

    // saga가 스스로 종료될 때까지 기다림
    .run(false);
});

docs/integration-testing/state.html.body:
State
You can test your saga's integration with your reducer and store state via the
withState, withReducer, and hasFinalState methods.
Static State via withState
For static state, you can just use the withState method to allow select
effects to work. You can also use
providers for this.
const storeState = {
  data: {
    foo: 'bar',
  },
};

function getData(state) {
  return state.data;
}

function* saga() {
  const data = yield select(getData);
  yield put({ type: 'DATA', payload: data });
}

it('can take store state', () => {
  return expectSaga(saga)
    .withState(storeState)
    .put({ type: 'DATA', payload: storeState.data })
    .run();
});

Dynamic State via withReducer
For state that might change, you can use the withReducer method. It takes two
arguments: your reducer and optional initial state. If you don't supply the
initial state, then withReducer will extract it by passing an initial action
into your reducer like Redux.
Any select effects will reflect state changes where appropriate. More
importantly, you can test your store state after the saga completes via
hasFinalState.
const initialDog = {
  name: 'Tucker',
  age: 11,
};

function dogReducer(state = initialDog, action) {
  if (action.type === 'HAVE_BIRTHDAY') {
    return {
      ...state,
      age: state.age + 1,
    };
  }

  return state;
}

function* saga() {
  yield put({ type: 'HAVE_BIRTHDAY' });
}

it('handles reducers when not supplying initial state', () => {
  return expectSaga(saga)
    .withReducer(dogReducer)
    .hasFinalState({
      name: 'Tucker',
      age: 12, //  {
  return expectSaga(saga)
    .withReducer(dogReducer, initialDog)
    .hasFinalState({
      name: 'Tucker',
      age: 12, // 
Exposed Store State
The Promise returned from run resolves with a storeState object that you
can inspect for more fine-grained testing.
it('exposes the store state', () => {
  return expectSaga(saga)
    .withReducer(dogReducer, initialDog)
    .run()
    .then((result) => {
      expect(result.storeState).toEqual({
        name: 'Tucker',
        age: 12, //  {
  const { storeState } = await expectSaga(saga)
    .withReducer(dogReducer, initialDog)
    .run();

  expect(storeState).toEqual({
    name: 'Tucker',
    age: 12, //

docs/integration-testing/mocking/static-.body:
Static Providers
You can provide mock values in a terse manner via static providers. Pass in
an array of tuple pairs (array pairs) into the provide method. For each pair,
the first element should be a matcher for matching the effect and the second
effect should be the mock value you want to provide. You can use effect creators
from redux-saga/effects as matchers or import matchers from
redux-saga-test-plan/matchers. The benefit of using Redux Saga Test Plan's
matchers is that they also offer partial matching. For example, you can use
call.fn to match any calls to a function without regard to its arguments.
import { call, put, select } from 'redux-saga/effects';
import { expectSaga } from 'redux-saga-test-plan';
import * as matchers from 'redux-saga-test-plan/matchers';
import api from 'my-api';
import * as selectors from 'my-selectors';

function* saga() {
  const id = yield select(selectors.getId);
  const user = yield call(api.fetchUser, id);

  yield put({ type: 'RECEIVE_USER', payload: user });
}

it('provides a value for the API call', () => {
  return expectSaga(saga)
    .provide([
      // Use the `select` effect creator from Redux Saga to match
      [select(selectors.getId), 42],

      // Use the `call.fn` matcher from Redux Saga Test Plan
      [matchers.call.fn(api.fetchUser), { id: 42, name: 'John Doe' }],
    ])
    .put({
      type: 'RECEIVE_USER',
      payload: { id: 42, name: 'John Doe' },
    })
    .run();
});

Matchers
Inside the redux-saga-test-plan/matchers module, there are matchers for most
of the effect creators available in Redux Saga. You can reference effect
creators in Redux Saga's docs
here.

actionChannel(pattern, [buffer])
apply(context, fn, args)
call([context, fn], ...args)
call(fn, ...args)
cancel(task)
cancelled()
cps([context, fn], ...args)
cps(fn, ...args)
flush(channel)
fork([context, fn], ...args)
fork(fn, ...args)
getContext(prop)
join(task)
put(action)
putResolve(action)
race(effects)
select(selector, ...args)
setContext(props)
spawn([context, fn], ...args)
spawn(fn, ...args)
take(pattern)
takeMaybe(pattern)

Partial Matchers
Sometimes you're not interested in matching a call effect with exact arguments
or a put effect with a particular action payload.
Instead you only want to match a call to a particular function or match a
put with a particular action type. You can handle these situations with
partial matchers.
The following assertions have a like method along with convenient helper
methods for partially matching assertions:

actionChannel
apply
call
cps
fork
put
put.resolve
select
spawn

NOTE: the like method requires knowledge of the properties on effects such
as the fn property of call and the action property of put. Essentially,
like allows you to match effects with certain properties without worrying
about the other properties. Therefore, you can match a call by fn without
worrying about the args property.
In addition to like, there are other some common helper methods like fn and
actionType available, appropriate to the kind of effect:



Method
Description




actionChannel.pattern
Match actionChannel by pattern. Useful if you use custom buffers with actionChannel.


apply.fn
Match apply by fn.


call.fn
Match call by fn.


cps.fn
Match cps by fn.


fork.fn
Match fork by fn.


put.actionType
Match put by action.type.


put.resolve.actionType
Match put.resolve by action.type.


select.selector
Match select by selector function.


spawn.fn
Match spawn by fn.



Ordering
Providers are checked from left to right (or top to down depending on how you
look at it). The first provider to match an effect is used, skipping subsequent
providers. If no providers match, then the effect is handled by Redux Saga as
normal.
import { call, put, select } from 'redux-saga/effects';
import * as matchers from 'redux-saga-test-plan/matchers';
import api from 'my-api';
import * as selectors from 'my-selectors';

function* saga() {
  const user = yield call(api.findUser, 1);
  const dog = yield call(api.findDog);
  const greeting = yield call(api.findGreeting);
  const otherData = yield select(selectors.getOtherData);

  yield put({
    type: 'DONE',
    payload: { user, dog, greeting, otherData },
  });
}

const fakeUser = { name: 'John Doe' };
const fakeDog = { name: 'Tucker' };
const fakeOtherData = { foo: 'bar' };

it('takes multiple providers and composes them', () => {
  return expectSaga(saga)
    .provide([
      [matchers.call.fn(api.findUser), fakeUser],
      [matchers.call.fn(api.findDog), fakeDog],
      [select(selectors.getOtherData), fakeOtherData],
    ])
    .put({
      type: 'DONE',
      payload: {
        user: fakeUser,
        dog: fakeDog,
        greeting: 'hello',
        otherData: fakeOtherData,
      },
    })
    .run();
});

Throw Errors
You can simulate errors with static providers via the throwError function from
the redux-saga-test-plan/providers module. When providing an error, wrap it
with a call to throwError to let Redux Saga Test Plan know that you want to
simulate a thrown error.
import { call, put } from 'redux-saga/effects';
import * as matchers from 'redux-saga-test-plan/matchers';
import { throwError } from 'redux-saga-test-plan/providers';
import api from 'my-api';

function* userSaga(id) {
  try {
    const user = yield call(api.fetchUser, id);
    yield put({ type: 'RECEIVE_USER', payload: user });
  } catch (e) {
    yield put({ type: 'FAIL_USER', error: e });
  }
}

it('handles errors', () => {
  const error = new Error('error');

  return expectSaga(userSaga)
    .provide([
      [matchers.call.fn(api.fetchUser), throwError(error)],
    ])
    .put({ type: 'FAIL_USER', error })
    .run();
});

Static Providers with Dynamic Values
Static providers can provide dynamic values too. Instead of supplying a static
value, you can supply a function that produces the value. This function takes as
arguments the matched effect as well as a next function. Additionally, you
must wrap the function with a call to the dynamic function from the
redux-saga-test-plan/providers module. Inside the provider function, you can
inspect the effect further and return a mock value or return a call to the
next function. Returning a call to the next function will tell Redux Saga
Test Plan to try the next provider, similar to a middleware stack. If there are
no more providers, then Redux Saga Test Plan will let Redux Saga handle the
effect.
import { call, put } from 'redux-saga/effects';
import * as matchers from 'redux-saga-test-plan/matchers';
import { dynamic } from 'redux-saga-test-plan/providers';

const add2 = a => a + 2;

function* someSaga() {
  const x = yield call(add2, 4);
  const y = yield call(add2, 6);
  const z = yield call(add2, 8);

  yield put({ type: 'DONE', payload: x + y + z });
}

const provideDoubleIf6 = ({ args: [a] }, next) => (
  // Check if the first argument is 6
  a === 6 ? a * 2 : next()
);

const provideTripleIfGt4 = ({ args: [a] }, next) => (
  // Check if the first argument is greater than 4
  a > 4 ? a * 3 : next()
);

it('works with dynamic static providers', () => {
  return expectSaga(someSaga)
    .provide([
      [matchers.call.fn(add2), dynamic(provideDoubleIf6)],
      [matchers.call.fn(add2), dynamic(provideTripleIfGt4)],
    ])
    .put({ type: 'DONE', payload: 42 })
    .run();
});

Other Examples
Parallel Effects via all
Providers work on effects yielded inside an all effect:
import { put, select } from 'redux-saga/effects';
import { expectSaga } from 'redux-saga-test-plan';
import { selectors } from 'my-selectors';

function* saga() {
  const [name, age] = yield all([
    select(selectors.getName),
    select(selectors.getAge),
  ]);

  yield put({ type: 'USER', payload: { name, age } });
}

it('provides values for effects inside arrays', () => {
  return expectSaga(saga)
    .provide([
      [select(selectors.getName), 'Tucker'],
      [select(selectors.getAge), 11],
    ])
    .put({
      type: 'USER',
      payload: { name: 'Tucker', age: 11 },
    })
    .run();
});

Providing in Forked/Spawned Sagas
Providers work for effects in forked/spawned sagas too.
import { call, fork, put } from 'redux-saga/effects';
import { expectSaga } from 'redux-saga-test-plan';
import * as matchers from 'redux-saga-test-plan/matchers';
import api from 'my-api';

function* fetchUserSaga() {
  const user = yield call(api.fetchUser);
  yield put({ type: 'RECEIVE_USER', payload: user });
}

function* forkingSaga() {
  yield fork(fetchUserSaga);
}

function* spawningSaga() {
  yield spawn(fetchUserSaga);
}

it('provides values in forked sagas', () => {
  return expectSaga(forkingSaga)
    .provide([
      [matchers.call.fn(api.fetchUser), fakeUser],
    ])
    .put({ type: 'RECEIVE_USER', payload: fakeUser })
    .run();
});

it('provides values in spawned sagas', () => {
  return expectSaga(spawningSaga)
    .provide([
      [matchers.call.fn(api.fetchUser), fakeUser],
    ])
    .put({ type: 'RECEIVE_USER', payload: fakeUser })
    .run();
});

More Examples
For some more contrived examples of providers, look in the
repo tests.
Caveats
For providers to work, expectSaga will necessarily wrap forked/spawned sagas
with an intermediary generator called sagaWrapper in order to intercept
effects. To ensure that your saga receives back a task object with a correct
meta.name property, Redux Saga Test Plan will attempt to rename the sagaWrapper
function to the name of a forked saga. This works in almost all JavaScript
environments but will fail in PhantomJS. Therefore, you can't depend on the
task meta.name property being correct in PhantomJS.

docs/integration-testing/mocking/dynamic.body:
Dynamic Providers
You can use completely dynamic providers by passing in an object literal to the
provide method. The object literal argument must contain effect creator names
as keys and function handlers as values. Each function handler takes two
arguments, the yielded effect and a next callback. You can inspect the effect
and return a fake value based on the properties in the effect. If you don't want
to handle the effect yourself, you can pass it on to Redux Saga by invoking the
next callback parameter.
Here is an example with Jest to show you how to supply a fake value for an API
call:
import { call, put, take } from 'redux-saga/effects';
import { expectSaga } from 'redux-saga-test-plan';
import api from 'my-api';

function* saga() {
  const action = yield take('REQUEST_USER');
  const id = action.payload;

  const user = yield call(api.fetchUser, id);

  yield put({ type: 'RECEIVE_USER', payload: user });
}

it('provides a value for the API call', () => {
  return expectSaga(saga)
    .provide({
      call(effect, next) {
        // Check for the API call to return fake value
        if (effect.fn === api.fetchUser) {
          const id = effect.args[0];
          return { id, name: 'John Doe' };
        }

        // Allow Redux Saga to handle other `call` effects
        return next();
      },
    })
    .put({
      type: 'RECEIVE_USER',
      payload: { id: 1, name: 'John Doe' },
    })
    .dispatch({ type: 'REQUEST_USER', payload: 1 })
    .run();
});

Effect Creators
Even though you'll probably never need them all, you can supply a provider for
almost every effect creator:

all
actionChannel
call *
cancel
cancelled
cps
flush
fork
getContext
join
put **
race
select
setContext
spawn
take **

*Because there is no way to distinguish the apply and call effects, you
must handle apply effects with the call provider function.
**To handle takeMaybe and putResolve, use the take and put providers,
respectively. You can inspect take effects for the maybe property and put
effects for the resolve property.
Other Examples
Select
import { put, select } from 'redux-saga/effects';
import { expectSaga } from 'redux-saga-test-plan';
import { selectors } from 'my-selectors';

function* saga() {
  const name = yield select(selectors.getName);
  const age = yield select(selectors.getAge);

  yield put({ type: 'USER', payload: { name, age } });
}

it('provides a value for the selector', () => {
  return expectSaga(saga)
    .provide({
      select({ selector }, next) {
        if (selector === selectors.getName) {
          return 'Tucker';
        }

        if (selector === selectors.getAge) {
          return 11;
        }

        return next();
      },
    })
    .put({
      type: 'USER',
      payload: { name: 'Tucker', age: 11 },
    })
    .run();
});

Parallel Effects via all
Providers work on effects yielded inside an all effect.
import { all, put, select } from 'redux-saga/effects';
import { expectSaga } from 'redux-saga-test-plan';
import { selectors } from 'my-selectors';

function* saga() {
  const [name, age] = yield all([
    select(selectors.getName),
    select(selectors.getAge),
  ]);

  yield put({ type: 'USER', payload: { name, age } });
}

it('provides values for effects inside arrays', () => {
  return expectSaga(saga)
    .provide({
      select({ selector }, next) {
        if (selector === selectors.getName) {
          return 'Tucker';
        }

        if (selector === selectors.getAge) {
          return 11;
        }

        return next();
      },
    })
    .put({
      type: 'USER',
      payload: { name: 'Tucker', age: 11 },
    })
    .run();
});

Or you can provide a value for the entire array of effects via the all
provider:
import { put, select } from 'redux-saga/effects';
import { expectSaga } from 'redux-saga-test-plan';
import { selectors } from 'my-selectors';

function* saga() {
  const [name, age] = yield all([
    select(selectors.getName),
    select(selectors.getAge),
  ]);

  yield put({ type: 'USER', payload: { name, age } });
}

it('provides a value for the entire array', () => {
  return expectSaga(saga)
    .provide({
      all: () => ['Tucker', 11],
    })
    .put({
      type: 'USER',
      payload: { name: 'Tucker', age: 11 },
    })
    .run();
});

Race
import { call, put, race, take } from 'redux-saga/effects';
import { expectSaga } from 'redux-saga-test-plan';
import api from 'my-api';

const delay = time => (
  new Promise(resolve => setTimeout(resolve, time))
);

function* saga() {
  const action = yield take('REQUEST_USER');
  const id = action.payload;

  const { user } = yield race({
    user: call(api.fetchUser, id),
    timeout: call(delay, 500),
  });

  if (user) {
    yield put({ type: 'RECEIVE_USER', payload: user });
  } else {
    yield put({ type: 'TIMEOUT' });
  }
}

test('fetching the user succeeds', () => {
  const fakeUser = { id: 1, name: 'John Doe' };

  return expectSaga(saga)
    .provide({
      race: () => ({ user: fakeUser }),
    })
    .put({ type: 'RECEIVE_USER', payload: fakeUser })
    .dispatch({ type: 'REQUEST_USER' })
    .run();
});

test('timeout wins', () => {
  return expectSaga(saga)
    .provide({
      race: () => ({ timeout: undefined }),
    })
    .put({ type: 'TIMEOUT' })
    .dispatch({ type: 'REQUEST_USER' })
    .run();
});

Errors
You can simulate errors by throwing from a provider:
function* saga() {
  const action = yield take('REQUEST_USER');
  const id = action.payload;

  try {
    const user = yield call(api.fetchUser, id);

    yield put({ type: 'RECEIVE_USER', payload: user });
  } catch (e) {
    yield put({ type: 'FAIL_USER', error: e });
  }
}

it('can throw errors in the saga', () => {
  const error = new Error('Whoops...');

  return expectSaga(saga)
    .provide({
      call(effect, next) {
        if (effect.fn === api.fetchUser) {
          throw error;
        }

        return next();
      },
    })
    .put({ error, type: 'FAIL_USER' })
    .dispatch({ type: 'REQUEST_USER', payload: 1 })
    .run();
});

Providing in Forked/Spawned Sagas
Providers work for effects in forked/spawned sagas too.
import { call, fork, put } from 'redux-saga/effects';
import { expectSaga } from 'redux-saga-test-plan';
import api from 'my-api';

function* fetchUserSaga() {
  const user = yield call(api.fetchUser);
  yield put({ type: 'RECEIVE_USER', payload: user });
}

function* forkingSaga() {
  yield fork(fetchUserSaga);
}

function* spawningSaga() {
  yield spawn(fetchUserSaga);
}

it('provides values in forked sagas', () => {
  return expectSaga(forkingSaga)
    .provide({
      call({ fn }, next) {
        if (fn === api.fetchUser) {
          return fakeUser;
        }

        return next();
      },
    })
    .put({ type: 'RECEIVE_USER', payload: fakeUser })
    .run();
});

it('provides values in spawned sagas', () => {
  return expectSaga(spawningSaga)
    .provide({
      call({ fn }, next) {
        if (fn === api.fetchUser) {
          return fakeUser;
        }

        return next();
      },
    })
    .put({ type: 'RECEIVE_USER', payload: fakeUser })
    .run();
});

Multiple Providers
You can supply multiple object providers via a couple of methods. The easiest
way is to pass in an array of object providers to the provide method. Provider
functions will be composed according to the effect type, meaning the provider
functions in the first object will be called before subsequent provider
functions in the array.
Because provider functions are composed, they are similar to middleware. The
next function argument inside provider functions allows you to delegate to the
next provider in the middleware stack. If no more providers are available, then
next will delegate to Redux Saga to handle the effect as normal.
import { call, put, select } from 'redux-saga/effects';
import api from 'my-api';
import * as selectors from 'my-selectors';

function* saga() {
  const user = yield call(api.findUser, 1);
  const dog = yield call(api.findDog);
  const greeting = yield call(api.findGreeting);
  const otherData = yield select(selectors.getOtherData);

  yield put({
    type: 'DONE',
    payload: { user, dog, greeting, otherData },
  });
}

const fakeUser = { name: 'John Doe' };
const fakeDog = { name: 'Tucker' };
const fakeOtherData = { foo: 'bar' };

const provideUser = ({ fn, args: [id] }, next) => (
  fn === api.findUser ? fakeUser : next()
);

const provideDog = ({ fn }, next) => (
  fn === api.findDog ? fakeDog : next()
);

const provideOtherData = ({ selector }, next) => (
  selector === selectors.getOtherData ? fakeOtherData : next()
);

it('takes multiple providers and composes them', () => {
  return expectSaga(saga)
    .provide([
      { call: provideUser, select: provideOtherData },
      { call: provideDog },
    ])
    .put({
      type: 'DONE',
      payload: {
        user: fakeUser,
        dog: fakeDog,
        greeting: 'hello',
        otherData: fakeOtherData,
      },
    })
    .run();
});

An alternative to supplying multiple provider objects is to only pass one object
into provide and use the composeProviders function to compose multiple
provider functions for a specific effect. You can import the composeProviders
function from the redux-saga-test-plan/providers module. The provider
functions are composed from left to right.
import { composeProviders } from 'redux-saga-test-plan/providers';

it('takes multiple providers and composes them', () => {
  return expectSaga(saga)
    .provide({
      call: composeProviders(
        provideUser,
        provideDog
      ),

      select: provideOtherData,
    })
    .put({
      type: 'DONE',
      payload: {
        user: fakeUser,
        dog: fakeDog,
        greeting: 'hello',
        otherData: fakeOtherData,
      },
    })
    .run();
});

More Examples
For some more contrived examples of providers, look in the
repo tests.
Caveats
For providers to work, expectSaga will necessarily wrap forked/spawned sagas
with an intermediary generator called sagaWrapper in order to intercept
effects. To ensure that your saga receives back a task object with a correct
meta.name property, Redux Saga Test Plan will attempt to rename the sagaWrapper
function to the name of a forked saga. This works in almost all JavaScript
environments but will fail in PhantomJS. Therefore, you can't depend on the
task meta.name property being correct in PhantomJS.

docs/integration-testing/partial-matchin.body:
Partial Matching Assertions
Sometimes you're not interested in the exact arguments passed to a call effect
creator or the payload inside an action from a put effect. Instead you're only
concerned with if a particular function was invoked via call or if a
particular action type was dispatched via put. You can handle these situations
with partial matcher assertions.
The following assertions have a like method along with convenient helper
methods for partially matching assertions:

actionChannel
apply
call
cps
fork
put
put.resolve
select
spawn

NOTE: the like method requires knowledge of the properties on effects such
as the fn property of call and the action property of put. Essentially,
like allows you to match effects with certain properties without worrying
about the other properties. Therefore, you can match a call by fn without
worrying about the args property.
Example
Here is a simple example using like:
function* userSaga(id) {
  try {
    const user = yield call(api.fetchUser, id);
    yield put({ type: 'RECEIVE_USER', payload: user });
  } catch (e) {
    yield put({ type: 'FAIL_USER', error: e });
  }
}

it('fetches user', () => {
  return expectSaga(userSaga)
    .call.like({ fn: api.fetchUser })
    .run();
});

it('fails', () => {
  return expectSaga(userSaga)
    .provide({
      call() {
        throw new Error('Not Found');
      },
    })
    .put.like({ action: { type: 'FAIL_USER' } })
    .run();
});

Notice that we can assert that the api.fetchUser function was called without
specifying the arguments. We can also assert in a failure scenario that an
action of type FAIL_USER was dispatched without worrying about the error
property of the action.
Helper Methods Example
We can simplify the previous example with the convenient matcher helper methods
call.fn and put.actionType:
function* userSaga(id) {
  try {
    const user = yield call(api.fetchUser, id);
    yield put({ type: 'RECEIVE_USER', payload: user });
  } catch (e) {
    yield put({ type: 'FAIL_USER', error: e });
  }
}

it('fetches user', () => {
  return expectSaga(userSaga)
    .call.fn(api.fetchUser)
    .run();
});

it('fails', () => {
  return expectSaga(userSaga)
    .provide({
      call() {
        throw new Error('Not Found');
      },
    })
    .put.actionType('FAIL_USER')
    .run();
});

Multiple Properties
If you need it in rare cases, you can match on multiple shallow or deep
properties via like:
function* saga(id) {
  yield put({
    type: 'FOO',
    payload: 42,
    meta: { hello: 'world' },
  });

  // This will be matched
  yield put({
    type: 'FOO',
    payload: 43,
    meta: { hello: 'world' },
  });
}

it('can match on multiple properties', () => {
  return expectSaga(saga)
    .put.like({
      action: {
        type: 'FOO',
        payload: 43,
      },
    })
    .run();
});

Helper Methods
There are other some common helper methods like fn and actionType available,
appropriate to the kind of effect:



Method
Description




actionChannel.pattern
Match actionChannel by pattern. Useful if you use custom buffers with actionChannel.


apply.fn
Match apply by fn.


call.fn
Match call by fn.


cps.fn
Match cps by fn.


fork.fn
Match fork by fn.


put.actionType
Match put by action.type.


put.resolve.actionType
Match put.resolve by action.type.


select.selector
Match select by selector function.


spawn.fn
Match spawn by fn.

docs/integration-testing/negated-asserti.body:
Negated Assertions
You can negate assertions too. Use the not property before calling an
assertion. Negated assertions also work with partial matcher assertions!
function* authSaga() {
  const token = yield select(authToken);

  if (token) {
    yield call(api.setToken, token);
  }
}

it('does not set the token', () => {
  return expectSaga(authSaga)
    .withState({})
    .not.call.fn(api.setToken)
    .run();
});

docs/integration-testing/exposed-effects.body:
Exposed Effects
The Promise returned by the run method resolves with an object that contains
any effects yielded by your saga and sagas that it forked. You can use this for
finer-grained control over testing exact number of effects. Be careful when
testing top-level sagas that fork other sagas because the effects object will
include yielded effects from all forked sagas too. There currently is no way to
distinguish between effects yielded by the top-level saga and forked sagas.
function* userSaga(id) {
  const user = yield call(fetchUser, id);
  const pet = yield call(fetchPet, user.petId);

  yield put({ type: 'DONE', payload: { user, pet } });
}

it('exposes effects', () => {
  const id = 42;
  const petId = 20;

  const user = { id, petId, name: 'Jeremy' };
  const pet = { name: 'Tucker' };

  return expectSaga(saga, id)
    .provide([
      [call(fetchUser, id), user],
      [call(fetchPet, petId), pet],
    ])
    .run()
    .then((result) => {
      const { effects } = result;

      expect(effects.call).toHaveLength(2);
      expect(effects.put).toHaveLength(1);

      expect(effects.call[0]).toEqual(call(fetchUser, id));
      expect(effects.call[1]).toEqual(call(fetchPet, petId));

      expect(effects.put[0]).toEqual(
        put({ type: 'DONE', payload: { user, pet } })
      );
    });
});

Of course, async functions work nicely with this feature too.
it('exposes effects using async functions', async () => {
  const id = 42;
  const petId = 20;

  const user = { id, petId, name: 'Jeremy' };
  const pet = { name: 'Tucker' };

  const { effects } = await expectSaga(saga, id)
    .provide([
      [call(fetchUser, id), user],
      [call(fetchPet, petId), pet],
    ])
    .run();

  expect(effects.call).toHaveLength(2);
  expect(effects.put).toHaveLength(1);

  expect(effects.call[0]).toEqual(call(fetchUser, id));
  expect(effects.call[1]).toEqual(call(fetchPet, petId));

  expect(effects.put[0]).toEqual(
    put({ type: 'DONE', payload: { user, pet } })
  );
});

Inspect Specific Properties
If you want to inspect specific properties on an effect, you can use the
asEffect util from Redux Saga.
import { asEffect } from 'redux-saga/utils';

it('can test properties on effects', () => {
  const id = 42;
  const petId = 20;

  const user = { id, petId, name: 'Jeremy' };
  const pet = { name: 'Tucker' };

  return expectSaga(saga, id)
    .provide([
      [call(fetchUser, id), user],
      [call(fetchPet, petId), pet],
    ])
    .run()
    .then((result) => {
      const { effects } = result;

      const fetchUserCall = asEffect.call(effects.call[0]);

      expect(fetchUserCall.fn).toBe(fetchUser);
      expect(fetchUserCall.args).toEqual([42]);
    });
});

All Effects
If you want all the effects consolidated in the order they were yielded, you can
use the allEffects property from the resolved object.
function* saga() {
  yield call(identity, 42);
  yield put({ type: 'HELLO' });
}

it('exposes all yielded effects in order', () => {
  return expectSaga(saga)
    .run()
    .then((result) => {
      const { allEffects } = result;

      expect(allEffects).toEqual([
        call(identity, 42),
        put({ type: 'HELLO' }),
      ]);
    });
});

Available Effects
The available effects are:

actionChannel
call
cps
fork
getContext
join
put
race
select
setContext
take

docs/integration-testing/snapshot-testin.body:
Snapshot Testing
The Promise from run resolves with a toJSON method that serializes the
effects to a form appropriate for snapshot testing.
function* saga(id) {
  const user = call(api.fetchUser, id);
  yield put({ type: 'DONE', payload: user });
}

it('can be used with snapshot testing', () => {
  return expectSaga(saga, 42)
    .run()
    .then((result) => {
      expect(result.toJSON()).toMatchSnapshot();
    });
});

The previous test would result in this snapshot. Notice that Redux Saga Test
Plan attempts to preserve functions yielded in call by serializing them to a
special string key. This depends on the function's having a name, but will
default to  for the function name if it's missing.
exports[`can be used with snapshot testing 1`] = `
Object {
  "put": Array [
    Object {
      "PUT": Object {
        "action": Object {
          "payload": Object {
            "CALL": Object {
              "args": Array [
                42,
              ],
              "context": null,
              "fn": "@@redux-saga-test-plan/json/function/fetchUser",
            },
          },
          "type": "DONE",
        },
        "channel": null,
      },
    },
  ],
}
`;

docs/integration-testing/return-value.ht.body:
Return Value
You can assert the return value of a saga via the returns method. This only
works for the top-level saga under test, meaning other sagas that are invoked
via call, fork, or spawn won't report their return value.
function* saga() {
  const data = yield call(someApi);
  return data;
}

it('returns a greeting', () => {
  return expectSaga(saga)
    .provide([
      [call(someApi), { hello: 'world' }],
    ])
    .returns({ hello: 'world' })
    .run();
});

The Promise returned from run also resolves with the top-level saga's return
value.
it('exposes the return value', () => {
  return expectSaga(saga)
    .provide([
      [call(someApi), { hello: 'world' }],
    ])
    .run()
    .then((result) => {
      expect(result.returnValue).toEqual({ hello: 'world' });
    });
});

it('exposes the return value using async/await', async () => {
  const { returnValue } = await expectSaga(saga)
    .provide([
      [call(someApi), { hello: 'world' }],
    ])
    .run();

  expect(returnValue).toEqual({ hello: 'world' });
});

docs/integration-testing/thrown-errors.h.body:
Thrown Errors
You can assert that the saga throws a particular error using the throws method:
function* saga() {
  throw new Error();
}

it('throws an error of type Error', () => {
  return expectSaga(saga)
    .throws(Error)
    .run();
});

It is also possible to match errors by [exact] value, which is useful for matching plain object errors:
function* saga() {
  throw { message: 'Plain Object Error' };
}

it('throws a plain object error', () => {
  return expectSaga(saga)
    .throws({ message: 'Plain Object Error' })
    .run();
});

Other assertions are also checked when an error is thrown. This can be used to verify cleanup code etc:
function* saga() {
  yield put({ type: 'API_STARTED' });

  try {
    yield call(callApi, '/users/', 'get');
  } catch (e) {
    yield put({ type: 'API_FAILED' });
    throw e;
  }

  yield put({ type: 'API_SUCCESS' });
}

it('cleans up on API error', () =>
  expectSaga(saga)
    .provide([
      [matchers.call.fn(callApi), throwError(apiError)],
    ])
    .put({ type: 'API_STARTED' })
    .call.fn(callApi)
    .put({ type: 'API_FAILED' })
    .throws(apiError)
    .run());

Negated assertions also work, however you must be wary that if the saga throws errors that don't match, the test will pass silently:
function* saga() {
  throw new Error();
}

// This test will pass!
it('doesnt throw an error of type CustomErrorType', () => {
  return expectSaga(saga)
    .not.throws(CustomErrorType)
    .run();
});

// This test will fail
it('doesnt throw an error of type Error', () => {
  return expectSaga(saga)
    .not.throws(Error)
    .run();
});

docs/integration-testing/forked-sagas.ht.body:
Forked Sagas
expectSaga assertions not only work for your main saga, but also for forked
sagas. Here is a minimal example where we can assert from a behavior perspective
that the saga(s) put the FORKED action regardless of which saga actually
puts it.
function* otherSaga() {
  yield put({ type: 'FORKED' });
}

function* saga() {
  yield fork(otherSaga);
}

function* sagaWithTakeEvery() {
  yield takeEvery('TAKE_EVERY', otherSaga);
}

it('forked saga runs', () => {
  return expectSaga(saga)
    // This action comes from the forked `otherSaga`!
    .put({ type: 'FORKED' })
    .run();
});

it('takeEvery saga runs', () => {
  return expectSaga(sagaWithTakeEvery)
    // This action comes from the forked `otherSaga`!
    .put({ type: 'FORKED' })
    .dispatch({ type: 'TAKE_EVERY' })
    .run();
});

it('fork assertion passes', () => {
  return expectSaga(saga)
    // There are other assertions besides `put`
    // if you want to use them.
    .fork(otherSaga)
    .run();
});

docs/unit-testing/.body:
Unit Testing
For unit testing, Redux Saga Test Plan exports a testSaga function that
creates a mock saga for you to assert effects on. testSaga is agnostic about
your testing framework, so it simply throws if the sequence of yielded effects
don't match your assertion effects.
Pass in your generator function as the first argument. Pass in additional
arguments which will be the arguments passed on to the generator function.
// ES2015
import { testSaga } from 'redux-saga-test-plan';

// ES5
var testSaga = require('redux-saga-test-plan').testSaga;

function identity(value) {
  return value;
}

function* otherSaga() {}

function* mainSaga(x, y, z) {
  try {
    const action = yield take('HELLO');
    yield put({ type: 'ADD', payload: x + y });
    yield call(identity, action);
    yield fork(otherSaga, z);
  } catch (e) {
    yield put({ type: 'ERROR', payload: e });
  }
}

const action = { type: 'TEST' };

// saga mock                    x   y  z
const saga = testSaga(mainSaga, 40, 2, 20);

The saga mock has next and throw iterator methods, so you can advance
through the saga. Pass in arguments to next to simulate response values from
yields. Similarly pass in arguments to throw to specify the thrown error.
Each next and throw call returns an API with effect assertions. All Redux
Saga effects are available such as call, put, take, fork, etc. An
additional effect called isDone allows you to assert that the generator as
reached the end.
function identity(value) {
  return value;
}

function* otherSaga() {}

function* mainSaga(x, y, z) {
  try {
    const action = yield take('HELLO');
    yield put({ type: 'ADD', payload: x + y });
    yield call(identity, action);
    yield fork(otherSaga, z);
  } catch (e) {
    yield put({ type: 'ERROR', payload: e });
  }
}

const action = { type: 'TEST' };

let saga = testSaga(mainSaga, 40, 2, 20);

// try path
saga.next().take('HELLO');
saga.next(action).put({ type: 'ADD', payload: 42 });
saga.next().call(identity, action);
saga.next().fork(otherSaga);
saga.next().isDone();

// Or chain together
saga = testSaga(mainSaga, 40, 2, 20);
saga
  .next()
  .take('HELLO')

  .next(action)
  .put({ type: 'ADD', payload: 42 })

  .next()
  .call(identity, action)

  .next()
  .fork(otherSaga)

  .next()
  .isDone();

// catch path
const error = new Error('My Error');
saga = testSaga(mainSaga, 40, 2, 20);
saga
  .next()

  .throw(error)
  .put({ type: 'ERROR', payload: error })

  .next()
  .isDone();

docs/unit-testing/error-messages.html.body:
Error Messages
If a yielded effect and assertion effect call don't match, then the mock saga
will throw an error showing the difference between the two.
function identity(value) {
  return value;
}

function* otherSaga() {}

function* mainSaga(x, y, z) {
  try {
    const action = yield take('HELLO');
    yield put({ type: 'ADD', payload: x + y });
    yield call(identity, action);
    yield fork(otherSaga, z);
  } catch (e) {
    yield put({ type: 'ERROR', payload: e });
  }
}

const action = { type: 'TEST' };

let saga = testSaga(mainSaga, 40, 2, 20);

saga.next().take('HI');

// Throws with below:
//
// SagaTestError:
// Assertion 1 failed: take effects do not match
// 
// Expected
// --------
// { channel: null, pattern: 'HI' }
// 
// Actual
// ------
// { channel: null, pattern: 'HELLO' }

saga = testSaga(mainSaga, 40, 2, 20);
saga
  .next()
  .take('HELLO')

  .next(action)
  .put({ type: 'ADD', payload: 43 });

// Throws with below:
//
// SagaTestError:
// Assertion 2 failed: put effects do not match
// 
// Expected
// --------
// { channel: null, action: { type: 'ADD', payload: 43 } }
// 
// Actual
// ------
// { channel: null, action: { type: 'ADD', payload: 42 } }

If the yielded effect and asserted effect are different types of effects, then
the saga will throw an error with a message showing the difference.
function identity(value) {
  return value;
}

function* otherSaga() {}

function* mainSaga(x, y, z) {
  try {
    const action = yield take('HELLO');
    yield put({ type: 'ADD', payload: x + y });
    yield call(identity, action);
    yield fork(otherSaga, z);
  } catch (e) {
    yield put({ type: 'ERROR', payload: e });
  }
}

const action = { type: 'TEST' };

const saga = testSaga(mainSaga, 40, 2, 20);

saga
  .next()
  .take('HELLO')

  .next(action)
  .take('WORLD');

// SagaTestError:
// Assertion 2 Failed: expected take effect, but the saga yielded a different effect
// 
// Expected
// --------
// { '@@redux-saga/IO': true,
//   TAKE: { channel: null, pattern: 'WORLD' } }
// 
// Actual
// ------
// { '@@redux-saga/IO': true,
//   PUT: { channel: null, action: { type: 'ADD', payload: 42 } } }

docs/unit-testing/saga-helpers.html.body:
Saga Helpers
Redux Saga Test Plan also offers assertions for the saga helper effects
takeEvery, takeLatest, takeLeading, and throttle.
import { call, takeEvery } from 'redux-saga/effects';
import testSaga from 'redux-saga-test-plan';

function identity(value) {
  return value;
}

function* otherSaga(action, value) {
  yield call(identity, value);
}

function* anotherSaga(action) {
  yield call(identity, action.payload);
}

function* mainSaga() {
  yield call(identity, 'foo');
  yield takeEvery('READY', otherSaga, 42);
}

// All good
testSaga(mainSaga)
  .next()
  .call(identity, 'foo')

  .next()
  .takeEvery('READY', otherSaga, 42)

  .finish()
  .isDone();

// Will throw
testSaga(mainSaga)
  .next()
  .call(identity, 'foo')

  .next()
  .takeEvery('READY', anotherSaga, 42)

  .finish()
  .isDone();

// SagaTestError:
// Assertion 2 failed: expected takeEvery effect, but the saga yielded a different effect
//
// Expected
// --------
// { FORK:
//    { context: null,
//      fn: [Function: takeEvery],
//      args: [ 'READY', [Function: anotherSaga], 42 ] } }
//
// Actual
// ------
// { FORK:
//    { context: null,
//      fn: [Function: takeEvery],
//      args: [ 'READY', [Function: otherSaga], 42 ] } }

docs/unit-testing/general-assertions.htm.body:
General Assertions
Other general assertions and helpers available are is, isDone, returns,
and inspect.



Assertion
Description




is
General purpose deep equal assertion


isDone
Assert at end of saga


returns
Assert saga returns a value and is done


inspect
Inspect the next yielded value for more fine-grained, custom testing



Generic Example
import { take } from 'redux-saga/effects';

function* mainSaga() {
  yield 42;
  yield { foo: { bar: 'baz' } };
}

let saga = testSaga(mainSaga);

saga
  .next()
  .is(42)

  .next()
  .is({ foo: { bar: 'baz' } })

  .next()
  .isDone();

returns Example
function* otherSaga(x) {
  return x * 2;
}

const saga = testSaga(otherSaga, 21);

saga
  .next()
  .returns(42);

inspect Example
If your saga yields a nondeterministic type of value or something not easily
covered by the effect assertions or other general assertions, then you can use
inspect to retrieve the actual yielded value and perform your own assertions
with your favorite assertion library.
function* saga() {
  yield () => 42;
}

testSaga(saga)
  .next()
  .inspect((fn) => {
    expect(fn()).toBe(42);
  });

docs/unit-testing/time-travel.html.body:
Time Travel
The mock saga can also time travel through the saga generator.



Method
Description




back(n?: number)
Back up a number of steps in the saga (defaults to 1)


restart(...args: Array)
Restart the saga from the beginning


finish(arg?: any)
Finish a saga early by forcing a return


save(label: string)
Save a point in history with a label


restore(label: string)
Restore a point in history (label must be saved prior)



Go Back or Restart
For simple time travel, the mock saga includes back and restart methods
which allow you to back up some number of steps or completely restart the saga.
This is useful for handling multiple control flow branches such as if/else and
try/catch.
back takes an optional number argument to specify the number of steps to back
up. It defaults to 1.
As its name suggestions, restart will restart your saga. If your saga takes
arguments, then you can restart with new arguments by passing them in to
restart. If you don't supply any arguments, then it will restart with whatever
original arguments you used.
function getPredicate() {}

function* mainSaga(x) {
  try {
    const predicate = yield select(getPredicate);

    if (predicate) {
      yield take('TRUE');
    } else {
      yield take('FALSE');
    }

    yield put({ type: 'DONE', payload: x });
  } catch (e) {
    yield take('ERROR');
  }
}

let saga = testSaga(mainSaga, 42);

// Back up one step by default
saga
  .next()
  .select(getPredicate)

  .back()
  .next()
  .select(getPredicate);

// Back up `2` steps to try `else` branch
saga = testSaga(mainSaga, 42);
saga
  .next()
  .select(getPredicate)

  .next(true)
  .take('TRUE')

  .next()
  .isDone()

  .back(2)
  .next(false)
  .take('FALSE')

  .next()
  .put({ type: 'DONE', payload: 42 })

  .next()
  .isDone();

// Restart from the beginning to throw
const error = new Error('My Error');
saga = testSaga(mainSaga, 42);

saga
  .next()
  .select(getPredicate)

  .next(true)
  .take('TRUE')

  .next()
  .put({ type: 'DONE', payload: 42 })

  .next()
  .isDone()

  .restart()
  .next()
  .throw(error)
  .take('ERROR')

  .next()
  .isDone();

// Restart to update the argument
saga = testSaga(mainSaga, 42);

saga
  .next()
  .select(getPredicate)

  .next(true)
  .take('TRUE')

  .next()
  .put({ type: 'DONE', payload: 42 })

  .next()
  .isDone()

  .restart('hello world')
  .next()
  .select(getPredicate)

  .next(true)
  .take('TRUE')

  .next()
  .put({ type: 'DONE', payload: 'hello world' })

  .next()
  .isDone();

Finish Early
If you want to finish a saga early like bailing out of a while loop, then you
can use the finish method.
function identity(value) {
  return value;
}

function* loopingSaga() {
  while (true) {
    const action = yield take('HELLO');
    yield call(identity, action);
  }
}

let saga = testSaga(loopingSaga);

saga
  .next()

  .take('HELLO')
  .next(action)
  .call(identity, action)
  .next()

  .take('HELLO')
  .next(action)
  .call(identity, action)
  .next()

  .finish()
  .next()
  .isDone();

// With argument(s)

saga = testSaga(loopingSaga);

saga
  .next()

  .take('HELLO')
  .next(action)
  .call(identity, action)
  .next()

  .take('HELLO')
  .next(action)
  .call(identity, action)
  .next()

  .finish(42)
  .returns(42);

Save and Restore History
For more robust time travel, you can use the save and restore methods. The
save method allows you to label a point in the saga that you can return to by
calling restore with the same label. This can be more useful and less brittle
than using the simple back method.
function getPredicate() {}
function getFinalPayload() {}

export default function* mainSaga() {
  try {
    yield take('READY');

    const predicate = yield select(getPredicate);

    if (predicate) {
      yield take('TRUE');
    } else {
      yield take('FALSE');
    }

    let payload = yield select(getFinalPayload);

    payload %= 101;

    yield put({ payload, type: 'DONE' });
  } catch (e) {
    yield take('ERROR');
  }
}

const saga = testSaga(mainSaga);

saga
  .next()
  .take('READY')

  .next()
  .select(getPredicate)

  .save('before predicate') // 
As the names suggest save and restore allow you to restore saved history.
This can sometimes be beneficial for fast forwarding through a saga.
saga
  .next()
  .take('READY')

  .next()
  .select(getPredicate)

  .save('before predicate') // 
NOTE
Despite what the previous example suggests, save and restore don't
necessarily allow you to jump forward in your saga. As mentioned, they
restore history. This means the saga will be restarted, and the history for
the named label will be applied to get you back to a certain point in the saga.
For some cases, you can use this to jump forward, but in other cases, you might
expect the internal state of your saga to be different from what the applied
history had. Here's an example to show what wouldn't work with save and
restore.
function getPredicate() {}
function itWasTrue() {}
function itWasFalse() {}

export default function* mainSaga() {
  try {
    yield take('READY');

    const predicate = yield select(getPredicate);

    if (predicate) {
      yield take('TRUE');
      yield call(itWasTrue);
    } else {
      yield take('FALSE');
      yield call(itWasFalse);
    }

    yield put({ type: 'DONE', payload: predicate });
  } catch (e) {
    yield take('ERROR');
  }
}

const saga = testSaga(mainSaga);

saga
  .next()
  .take('READY')

  .next()
  .select(getPredicate)

  .save('before predicate') // 
Even though we restore the 'before predicate' label and supply a new value to
the predicate variable, that will get overwritten to whatever the history for
predicate was when we saved the 'before final put' label. True time travel
is not available yet but is a tentatively planned feature in the future. Ideas
and contributions are welcome to add true time travel.
